import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import { CartProvider } from './context/CartContext';
import ProtectedRoute, { GuestRoute, SellerRoute } from './components/ProtectedRoute';

// Import styles
import './styles/main.css';

// Import pages
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import Profile from './pages/Profile';
import SellerDashboard from './pages/SellerDashboard';

// Placeholder components for routes not yet implemented
const Products = () => (
  <div className="page">
    <div className="container">
      <h1>صفحة المنتجات</h1>
      <p>قيد التطوير...</p>
    </div>
  </div>
);

const ProductDetail = () => (
  <div className="page">
    <div className="container">
      <h1>تفاصيل المنتج</h1>
      <p>قيد التطوير...</p>
    </div>
  </div>
);

const Cart = () => (
  <div className="page">
    <div className="container">
      <h1>سلة التسوق</h1>
      <p>قيد التطوير...</p>
    </div>
  </div>
);

const Checkout = () => (
  <div className="page">
    <div className="container">
      <h1>إتمام الشراء</h1>
      <p>قيد التطوير...</p>
    </div>
  </div>
);

const Orders = () => (
  <div className="page">
    <div className="container">
      <h1>طلباتي</h1>
      <p>قيد التطوير...</p>
    </div>
  </div>
);

const SellerProducts = () => (
  <div className="page">
    <div className="container">
      <h1>إدارة المنتجات</h1>
      <p>قيد التطوير...</p>
    </div>
  </div>
);

const AddProduct = () => (
  <div className="page">
    <div className="container">
      <h1>إضافة منتج جديد</h1>
      <p>قيد التطوير...</p>
    </div>
  </div>
);

const SellerOrders = () => (
  <div className="page">
    <div className="container">
      <h1>طلبات المتجر</h1>
      <p>قيد التطوير...</p>
    </div>
  </div>
);

const NotFound = () => (
  <div className="page" style={{ textAlign: 'center', paddingTop: 'var(--space-3xl)' }}>
    <div className="container">
      <h1 style={{ fontSize: '6rem', color: 'var(--gray-300)' }}>404</h1>
      <h2>الصفحة غير موجودة</h2>
      <p style={{ color: 'var(--gray-500)', marginBottom: 'var(--space-xl)' }}>
        عذراً، الصفحة التي تبحث عنها غير موجودة
      </p>
      <a href="/" className="btn btn-primary">
        العودة للرئيسية
      </a>
    </div>
  </div>
);

function App() {
  return (
    <Router>
      <AuthProvider>
        <CartProvider>
          <div className="app">
            <Routes>
              {/* Public Routes */}
              <Route path="/" element={<Home />} />
              <Route path="/products" element={<Products />} />
              <Route path="/products/:id" element={<ProductDetail />} />
              
              {/* Guest Routes (redirect if authenticated) */}
              <Route 
                path="/login" 
                element={
                  <GuestRoute>
                    <Login />
                  </GuestRoute>
                } 
              />
              <Route 
                path="/register" 
                element={
                  <GuestRoute>
                    <Register />
                  </GuestRoute>
                } 
              />

              {/* Protected Routes (require authentication) */}
              <Route 
                path="/profile" 
                element={
                  <ProtectedRoute>
                    <Profile />
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/cart" 
                element={
                  <ProtectedRoute>
                    <Cart />
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/checkout" 
                element={
                  <ProtectedRoute>
                    <Checkout />
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/orders" 
                element={
                  <ProtectedRoute>
                    <Orders />
                  </ProtectedRoute>
                } 
              />

              {/* Seller Routes (require seller role) */}
              <Route 
                path="/seller/dashboard" 
                element={
                  <SellerRoute>
                    <SellerDashboard />
                  </SellerRoute>
                } 
              />
              <Route 
                path="/seller/products" 
                element={
                  <SellerRoute>
                    <SellerProducts />
                  </SellerRoute>
                } 
              />
              <Route 
                path="/seller/products/new" 
                element={
                  <SellerRoute>
                    <AddProduct />
                  </SellerRoute>
                } 
              />
              <Route 
                path="/seller/products/:id/edit" 
                element={
                  <SellerRoute>
                    <AddProduct />
                  </SellerRoute>
                } 
              />
              <Route 
                path="/seller/orders" 
                element={
                  <SellerRoute>
                    <SellerOrders />
                  </SellerRoute>
                } 
              />

              {/* 404 Page */}
              <Route path="*" element={<NotFound />} />
            </Routes>
          </div>
        </CartProvider>
      </AuthProvider>
    </Router>
  );
}

export default App;
